import React,{useState,useEffect} from 'react'
import { chart } from 'react-chartjs-2';

export default function Chart() {
    return (
        <div>
            <Chart
            data={data}
            width={100}
            height={50}
            options={{ maintainAspectRatio: false }}
            />
        </div>
    )
}
